IQ Boost is a game with tricky puzzles, tasks and logic tests. 
All the tasks are original and funny! We said ‘NO’ to boring brain training.
Free IQ Boost game features only the best tasks, brainteasers and exercises to train your memory, attention, logic and mindset. 

Only 10% of all the people have an IQ higher than 120. Are you among them? Play IQ Boost - challenge your brain.

Try yourself in solving nontrivial tasks. You will train logical and abstract thinking by solving puzzles and logic tasks. Сoncentration and memory will be better too. 
Have a good time while training your brain. 

Find out your IQ level. Lower than you thought? Play IQ Boost and you’ll see your IQ is growing. 

Game features:
• Easy to play;
• Nonstandard colourful gameplay;
• Funny answers and solutions;
• Nontrivial challenges for any age;
• Lots of levels;
• Intellectual brain-teaser game.

Remember: obvious solutions might not be not always right...think out of the box and train your brain! Play and prove you are the cleverest!

Use your brainpower and focus to solve anti-stress levels while enjoying a relaxing and hypnotizing experience when you find the solution. Destination is a game where you need to drive a ball to its destination, but by following certain strict rules. 

If you are confident about the pattern, click "Play" and see the magic. If you fail, you can try it again. The levels will be increasingly difficult, to properly train your brain.

Destination is a puzzle mix of geometry, thinking, relaxation and creativity!


Features

• Minimalist Game & Graphics;
• Can be played with a single finger;
• Develop your mental skills and focus;
• Snackable;
• Anti-Stress;
• Relaxing and hypnotizing effects.
• Perfect for people who aim to reach perfection or that suffer from OCD;


How to play Destination

The goal of this free puzzle game is to place the blocks by rotating such that you can send the ball to its final destination. It has reminiscences of snooker but with an added puzzle element. Keep in mind that the ball needs to touch all of the stars while going into the destination. 


Levels

The first levels are easy, but the levels become more difficult as you advance.

On some levels, you will face new features and mechanics! With this kind of new obstacle, the game will be more difficult but more enjoyable at the same time as you advance. If you can not pass to the next level even if you try your best, we have good news for you! If you watch a really short video ad, you will see the solution for the levels. 



